bool CAdjustImgHandler::SetNeedProcessImage(Bitmap* pInputBitmap)
{
	SAFE_DELETE(m_pMainBitmap);
	if(pInputBitmap == NULL)
		return false;

	int nWidth = pInputBitmap->GetWidth();
	int nHeight = pInputBitmap->GetHeight();
	m_pMainBitmap = new Bitmap(nWidth,nHeight);
	Graphics gs(m_pMainBitmap);
	gs.DrawImage(pInputBitmap,0,0,nWidth,nHeight);
	return TRUE;
}
