void CAdjustImgHandler::BrightAndContrast(short ArgBright,short ArgContrast,BOOL ArgIsOld)
{
	if(m_pMainBitmap == NULL)
		return ;

	SAFE_DELETE(m_pResultBitmap);
	

	RGBQUAD * pSrcRgb=NULL;
	RGBQUAD * pResultRgb = NULL;
	UCHAR values[0x100];
	BitmapData SrcBmpData;
	BitmapData ResultBmpData;
	int Srcoffset ;
	int Resultoffset;
	memset(values,0x00,0x100);
	if(m_pMainBitmap == NULL)
		return ;

	MakeMidValue(values, ArgBright, ArgContrast, 0);
	m_pResultBitmap = new Bitmap(m_pMainBitmap->GetWidth(),m_pMainBitmap->GetHeight());
	Rect rc(0,0,m_pMainBitmap->GetWidth(),m_pMainBitmap->GetHeight());
	
	m_pMainBitmap->LockBits(&rc, ImageLockModeRead | ImageLockModeWrite, PixelFormat32bppRGB, &SrcBmpData);
    m_pResultBitmap->LockBits(&rc,ImageLockModeRead|ImageLockModeWrite, PixelFormat32bppRGB,&ResultBmpData);
	int PicWidth=SrcBmpData.Width;
	int PicHeight=SrcBmpData.Height;
	pSrcRgb = (RGBQUAD *)SrcBmpData.Scan0;
	pResultRgb = (RGBQUAD*)ResultBmpData.Scan0;
	Srcoffset= (SrcBmpData.Stride - SrcBmpData.Width * 4);
	Resultoffset=(ResultBmpData.Stride-ResultBmpData.Width*4);
	for (UINT x = 0; x < PicHeight; x++, pSrcRgb = (RGBQUAD*)((BYTE *)pSrcRgb + Srcoffset), pResultRgb = (RGBQUAD*)((BYTE *)pResultRgb + Resultoffset))//
	{
		for (UINT y = 0; y < PicWidth; y++, pSrcRgb++,pResultRgb++)
		{
;
			pResultRgb->rgbGreen = values[pSrcRgb->rgbGreen];	
			pResultRgb->rgbBlue = values[pSrcRgb->rgbBlue];	
			pResultRgb->rgbRed = values[pSrcRgb->rgbRed];
		}
	}
	m_pMainBitmap->UnlockBits(&SrcBmpData);
	m_pResultBitmap->UnlockBits(&ResultBmpData);
	Graphics gs(m_pResultBitmap);
	gs.DrawImage(m_pResultBitmap,0,0,m_pResultBitmap->GetWidth(),m_pResultBitmap->GetHeight());
	UpdateImageData();
	SAFE_DELETE(m_pResultBitmap);
}

